import React from "react";
import MovieContainer from "./MovieContainer.js";
import List from "./List.js";
const MainContainer =()=>{
    return(
        <div>
            <MovieContainer/>
            
            <div className="-mt-60 relative z-10">
                <List/>
                <List/>
                <List/>
                <List/>
            </div>
            
        </div>
    )
}
export default MainContainer
